description:
Descrizione:

Si tratta di un Satrip tratto dalla trasmissione &quot;Record&quot; in occasione del decennale dalla scomparsa del campione brasiliano.
Questo doc ripercorre le fasi salienti della carriera di Ayrton e contiene interviste ai personaggi che lo hanno conosciuto, come Alain Prost, Gerard Berger, Damon Hill, Frank Williams


